INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (4, '2nd Flush', '# 简介
 このサイトは、同人音楽サークル「2nd Flush」のページです。
読みは「セカンドフラッシュ」です。
主にゲームのアレンジ曲やオリジナル曲を製作しています。
インスト系全般に曲を作っています。
懐かしさのある曲や個性の有る作品を作っていきたいと思います。
楽曲のゲスト等基本無償で引き受けていますので気になればご連絡ください。

サークル代表：秋ノ(Akino)※このサイトの管理人しています。
音楽：トランスやハウスな音楽が好みです。作ってる曲は、テクノな感じが多いです。
趣味：写真撮影（主に風景よりも物を写すのが好きです）
出没地域：東京及び関東周辺イベント。
なので、見かけたら友達になりたい人とか気軽に声かけてください。

', 'http://p2.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg', 12447097, '2nd Flush', 1033);
INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (5, '東京アクティブNEETs', '# 简介
 東京アクティブNEETs
東京アクティブNEETsは、日本のジャズインストバンド。

2008年に活動を開始、当初はオールジャンルの音楽を発表していたが、2010年の「東方爆音ジャズ」の制作以降、現代の日本のジャズシーンを反映した作品を作り続けている。

通常の音楽活動に加え、動画制作がメインの活動。

セルフレコーディングはもちろんの事、さらに実際のレコーディング風景の撮影をメンバー自ら行いミュージックビデオの制作をしていることも特徴である。

', 'http://p2.music.126.net/NtR8220AfQ8nZ-rEV_xfCg==/18537766046079734.jpg', 161328, '東京アクティブNEETs', 1586);
