INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (7, 'Iron Attack!', '# 简介
 Country of origin:
Japan
Location:
Tokyo
Status:
Active
Formed in:
2006
Genre:
Progressive/Power Metal
Themes:
Mostly instrumental, Touhou, Fantasy
Current label:
Unsigned/independent
Years active:
2006-present
Some of the band\'s album art are parodies of other well known metal bands, such as Judas Priest and Children of Bodom.

Iron Attack release their music through their own, self-titled, record label.

Their s/t album consists of original material. Most other albums are arrangement albums of various franchises (Touhou, Kantai Collection, Azur Lane).

Iron-Chino	Guitars
See also: Lightning, ex-Heavy Metal Kingdom, Five Rings


IRON ATTACK!は、2006年より同人音楽シーンに於いて、常に第一線を走り続けるヘビーメタルバンドです。 2012年より、同人シーンでは異例となる、全国ライブツアーを展開し、2013年には、同人音楽の歴史上初となる、ワールドツアーを実現させています。 現在までに、ドイツ、フランス、スペイン、オーストリア、台湾、香港、中国、タイ、スイス等でのライブを成功させており、”世界戦略で最も成功した同人音楽グループ”と言われています。 2013年、TORANOANA RECORDS（日本コロムビア）よりメジャーデビュー。 声優やゲーム主題歌などへの提供も多数。

', 'http://p2.music.126.net/uF_w-y9JyfC3JUodphuSWw==/109951170334037378.jpg', 14353, 'Iron Attack!', 1780);
