INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (23, 'V.A.', '# 简介
 Various Artists简称VA或者V.A，意思是各种各样的艺术家又称“群星”。很多是合辑的专辑开头都冠以Various Artists，指该专辑不是个人的。在日韩音乐界，这样的合辑十分常见，它们集结了众多优秀的音乐人，以多元化的音乐风格和丰富的音乐元素，给听众带来全新的听觉体验。
这些日韩群星合辑通常涵盖了多种音乐流派，从流行、摇滚、电子到民谣等，不一而足。它们集结了来自日本和韩国的顶尖歌手、音乐组合和乐团，每位参与者都以其独特的音乐才华和风格，为合辑注入了新的活力和创意。
这些日韩群星合辑的推出，不仅为听众提供了更多元化的音乐选择，也为日韩音乐人提供了一个展示自己才华的平台。通过这些合辑，听众可以更深入地了解和欣赏到日韩音乐的多样性和魅力，感受到不同文化背景下的音乐风格和创意碰撞。

', 'http://p1.music.126.net/PiAa3TTxGruRPa1hwsQ_ow==/109951163805681797.jpg', 21138, 'V.A.', 2237);
