INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (32, 'emroots', '# 简介
 中学時代に作曲をしてみたいと望むものの、作曲理論はもちろん、演奏の真似事すらも出来ない状態。
高校時代には、とりあえず鍵盤のコードの抑え方を覚え、雑誌のコード進行にメロディーをつける
程度のことをして、基礎能力を身につける。
大学時代に作曲ソフト（cakewalk homestudio6.0)とSC-88Proを購入するものの、どう使うのか分からず挫折。
大学卒業間近になり、「BM98」と出会い、自分もこういう曲を作ってみたいと思うようになったことが、
楽曲再挑戦の始まり。
ほぼ同時期に自宅のネット環境が整い、ネット上で拙い曲をアップするようになる。

ネットでの活動開始が大きな転機だったが、そこから半年後の「同人」との出会いが、音楽人生更にを大きく変えることとなる。
同人を知った4ヵ月後くらいには、初の同人サークル活動を開始し、アレンジ楽曲を手がける。
…が、周りのレベル差に愕然。
当然といえば当然の結果だけども、そこから地道に活動を継続。

', 'http://p2.music.126.net/-FZqXoPMoTs1qhCHIn3VRQ==/109951163327037706.jpg', 19318, 'emroots', 1864);
