INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (34, 'Sound Refil', '# 简介
 ● Sound Refil とは　　　 たくろすによる同人活動、二次創作物を公開した音楽が中心の同人サークルです。
 
● サークル名由来　　　　　読み方はサウンドリフィル。リフィルとは英語で『refill』意味は補充するという意味です。　
ではなぜＬが一つぬけているのか？それは一つ一つの作品が完成したとしても、それ
で満足していてはさらなる成長が望めないと私は思います。だから完全は無い、いつま
でもが勉強なんだ！自分の足りない所は補充していくんだ！という意味を込めてＬを一　
