INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (104, '天門', '# 简介
 专职日本电脑游戏及动画音乐的作曲家，本名为白川 笃史。白川笃史在Falcom任职的十余年里，风格逐渐凸显，而在三部曲里更是风光无限。1991年他以本名加入Falcom，是falcom Sound team jdk成立初期最早加入的成员之一。白川笃史对Falcom Sound team jdk的最大贡献在于强调了配乐作品的旋律性，即使在加入Sound team jdk初期电子摇滚风味浓重的FM音源时期，游戏配乐旋律性在他之后也有了较明显的改善。在Sound team jdk以外，白川笃史以天门名义发表的个人作品中更鲜明体现出对音画系和治愈系音乐的得心应手，钢琴和弦乐的悠扬旋律纯静优美、沁透人心，为新海诚动画制作的配乐更是感动了无数青春年少的心灵。治愈系之外的作品也多半以其清新隽永的旋律引人流连忘返。虽然在编曲方面对Techno、POP和摇滚等曲风的驾驭并不那么游刃有余，但由于他非常善于扬长避短，所以整体上依然瑕不掩瑜。

', 'http://p1.music.126.net/55hjrxP6nfgh8oMUQRq92Q==/19024849695618297.jpg', 15599, '天門', 2591);
