INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (291, 'Diverse System', '# 简介
 Diverse Systemとは、YsK-与作が2000年に立ち上げたレーベルのようなモノです。 色々な「与作個人がファンである」クリエイターの皆様に楽曲を書いていただけるよう、 お願いをして毎回１枚のCDを作成しています。 最初はとある大会の運営資金補助の為に一部のクリエイター方にお願いしたものです。 それがD1になります。 大会自体は終了したのですが、与作個人が面白いと思ったのか、 「もっとこの人たちのBEMANIのRemixが聞きたい」 と思ったので、続けることになりました。 この考えは、D4までそのまま受け継がれています。 DSOではそれが「Remixでなく、こいつらの音が聞きたい」となったわけです。

