INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (311, '369', '# 简介
 369 / みろく 15歳でアコースティックギターを始め、人生初バンド結成の為、程なくエレキギターを始める。 邦楽洋楽問わずコピーをし、高校時代のほとんどをギターの練習とバンド活動に費やす。その結果として成績は低空飛行、ギリギリのところでどうにか大学に合格。大学入学後、ジャズロックバンドを結成し、本格的な活動を開始する。

年間数十本に及ぶライブを行いながらアルバムを製作する等、高校時代に拍車をかけて学業から疎遠になり成績は超低空飛行、いよいよ浮世離れが進む。 バンドを脱退後、ゲーム音楽や劇判などのBGM作品の作曲を手がける作編曲家として活動し、現在に至る。

', 'http://p2.music.126.net/e82sCiprZgiGtKU0i8frcw==/18830236139218949.jpg', 12457252, '369', 2408);
