INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (321, 'SuganoMusic', '# 简介
 SuganoMusicは、ユーロビートを中心とした音楽サークルです。 オリジナルＣＤの製作、企画やゲーム等への楽曲提供、バンドやアイドル等への楽曲提供を行なっています。 元々はSuganoが個人的に活動する為の名前でしたが、2012年7月よりサークルとしてメンバー募集し活動をスタートしました。 ＣＤへの参加依頼、楽曲の製作依頼、いつでも大歓迎です！ お気軽に掲示板やメールでお問い合わせ下さい！(*´ω｀*) また、ボーカルや作詞や各種楽器演奏などで手助けしていただける方も随時募集しています！

