INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (329, 'Riot Shift', '# 简介
 Riot Shift，成员Ole Baehr和Connor Kratz，是Theracords团队的稳定力量，他们为Hardstyle带来了许多新鲜的实验声音。迷人的氛围，沉重的击打是他们音乐风格的定义。他们是在2016年底的一次合作中，找到了彼此对音乐的共识，并决定一起继续他们的音乐生涯。在Fatality，Ground Zero Festival和Loudfest（由b2s）等活动中演出，为他们的DJ生涯奠定了基调。与此同时，他们独特的作品得到了Delete，Deetox，Dj Thera和Regain等艺术家的持续支持。在签下Theracords后，Riot Shift凭借像Extasis，Engage，Sin＆Sentence和Boundaries这样的大型曲目，在短时间内取得了很多成就。

', 'http://p2.music.126.net/LLevPXE4LGbf9Hrovoea6Q==/109951163910760337.jpg', 12533253, 'Riot Shift', 2608);
