INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (340, 'Alice in the hole!', '# 简介
 十一歳の時にDeep purpleのカセットを聴いたのがきっかけでギターを始めることに。
中高とぼっちになり、ベッドルームギタリストの道を着々と歩む。
(このころからMTRを使って曲(というよりリフ)を作ったりしていた)
人生初のライブ出演は大学のサークルに入ってから。

大学在学中、他大のゲーム制作プロジェクトに作曲担当として参加。
DTMを始めたのはそれが直接のきっかけとなる。
同プロジェクトは第五回福岡ゲームコンテストにて入賞。

ニコニコ動画に投稿したりし始めたのもこの頃。
2012年6月には音楽サークルAlice in the hole!を設立し、同人音楽活動を開始する。以後色々CDとか出したりしている。

2013年4月、ニコニコ超会議2にてavexスペシャルバンドのギターを担当。

同年6月、DTMマガジン 2013年7月号にインタビュー掲載。

同年10月よりデスおはぎさん率いる漢バンドのギターを担当。

その後、バンドを組もうとしたりサポートなどをしたりしつつ今に至る。

', 'http://p2.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg', 1084165, 'Alice in the hole!', 2712);
