INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (397, 'ミツメ', '# 简介
 ミツメ2009年成立于日本东京，由川边、大竹、须田和、nakayaan组成。最初以自主录音为中心展开活动，2010年开始进行现场演出。
2011年8月，用将近一年时间完成录音的首张专辑《mitsume》发行。
2012年9月，第二张专辑《eye》发行。在积极同国内外音乐人共演的同时，乐队还远赴印度尼西亚演出，音乐活动渐入佳境。
2014年对于ミツメ来说充满挑战。2月，随著第三张专辑《ささやき》（Sasayaki）的发售，乐队在日本国内进行了由7场演出构成的巡迴演 出。同年3月在惠比寿LIQUIDROOM（东京）进行的巡迴演出终场"ささやき Release Tour Final"也获得成功。10月，《TOUR 2014》发售，将此次巡迴演出的场景以DVD和写真书的形式呈现。12月，乐队开始了首次专场巡迴演出“Blue Hawaii Session Tour”。
延续2014年的良好势头，2015年5月，第二张单曲《めまい》(Memai)发售，并于6月开始在全国进行了5场演出。7月，为期两天的首次 礼堂专场演出在青山spiral hall（东京）盛况落幕。今后，ミツメ也会继续将自己的音乐带去更远的地方。

', 'http://p1.music.126.net/-tSqSDkGeD6t8XdQ-UDASQ==/109951164976123644.jpg', 837714, 'ミツメ', 2708);
