2012年、新たにボーカロイド楽曲等を制作する音楽制作集団として「lol project」を立ち上げた。
2023年現在、これまでに約200曲のボーカロイド楽曲を約30人のクリエイターと共に世に放っている。
主にミクトランスやミックンベースを中心とした楽曲を制作しているが、
最近ではダムと音楽を融合させた新たなジャンルの普及に尽力している。

