INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (506, 'WAVE', '# 简介
 WAVE（1999-）WAVE社是日本同人音乐界资格比较老的大牌社团,擅长多数音乐制作,目前仍在稳定的活动中。
目前社团主要由Morrigan和Lily负责，擅长幻想民族风类曲目，近期作品也有偏向灾难史诗风的趋势。社团作品的显著特点就是恢宏大气，作品风格鲜明，拥有极高的辨识度，能让人在众多作品中一眼识别。由于社团活动时间较长且作品多，制作的同人作品范围也很宽阔，社团早期主要制作过知名的东方交响九部曲，型月的月姬和FATE，空境，寒蝉，AIR等，监制，编曲，曲调等方面走的古典风格，大起大落非常明显，实体乐器演奏居多。由于2008年原策划Rio去世（1979-2008）WAVE在此之后逐渐转型
目前社团有四位成员：
Lily (https://x.com/lily_YuriNazuka)
Vocalist｜Lyricist｜Composer｜Planner
我是和兔子一起生活的“WAVE”万事通。身体有点弱，活动结束后的第二天基本都会累倒。原本是Niconico的唱见，擅长创作并演唱复杂的多重和声。因为母亲的意愿，从2岁起就被硬拉着去上雅马哈音乐教室，拥有绝对音感。但或许是因为满脑子都是创作、不愿遵守乐谱指示，钢琴老师曾评价“你弹的肖邦，是对肖邦的不尊重”。
我经常忘了吃饭，人也因此变瘦，所以身边的朋友总是抢着给她投喂。
最近我成了彻头彻尾的美妆护肤爱好者，家里都快变成药店了。

Morrigan（https://x.com/Morrigan1678）
Lyricist｜Composer｜Mixer｜SFX artist
是WAVE的技术担当，特别爱惜设备。爱好是练肌肉和开车。他是理论派，能应对各种风格的创作工作。因为要迁就Lily的“电子设备小白”属性，经常被迫当她的“专属客服”。
他超喜欢猫，和附近的流浪猫关系都很好，可惜偏偏有严重的猫过敏。他痴迷“精灵”相关的设定，一聊起这个就停不下来，常常让Lily觉得很无奈。

暁星ちかげ(https://x.com/cheema0223)
Video Editor
是个“极限社畜”动画师。白天本职工作是做视频，回到家后依然在做视频。
从初二开始，她既燃起了“中二魂”，也开启了唱见生涯，一直慢悠悠地坚持着相关活动。
她凭借天生的开朗性格和充满力量的嗓音，偏爱演唱高音向以及摇滚、动漫歌曲类的曲目。小学时加入管乐队，初中时在合唱团，活动初期还去上过一段时间声乐课——不管怎么说都是个超爱唱歌的人，但她最后为什么会从事视频制作这一行，连她自己都觉得是个谜。

あしゅ(https://x.com/ashu_uta)
Web Developer｜Video Editor
是一位既做网站开发、又做视频编辑的多面创作者。
因为排版上细微的偏差就耗掉一整天，对她来说早已是家常便饭。实际上她是日本出生、海外长大的三语使用者。受通过漫画和动画锻炼日语的影响，偶尔会说出让人摸不着头脑的日语。
学生时代曾自学接触过多种乐器，总算练就了一定的乐感，但至今仍没法和乐谱“好好相处”。最近，欣赏自己取名为“萨博（サボ）”和“滕（テン）”的仙人掌们，已经成了她每天的固定事项。

', 'http://p1.music.126.net/8hFr4iqd1Q5NqxKoMSoewQ==/109951172050855296.jpg', 22342, 'WAVE', 1752);
