INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (683, 'Chinese Football', '# 简介
 冲出亚洲，走向世界，全力以赴，体无完肤。Chinese Football是一个无比真诚的玩笑，一个成立于2011年愚人节的真人游戏，他们是四个来自东方芝加哥的年轻人，他们是97一代国足的噪音遗产与97世代独立摇滚的回响余温。

Chinese Football所有的作品都在讲述同一个故事：一个幻想及其挫败。这些简单/糅杂/流畅/生涩的音乐中充斥着说话（在蒸发）、梦想（在坍塌）、热血（仍未冷）、呐喊（怯意地）。

', 'http://p1.music.126.net/Cpw_9JWY_4Bt_HIiizgBqQ==/109951163244467584.jpg', 1081839, 'Chinese Football', 2307);
