INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (746, 'ねこみりん', '# 简介
 愛知県名古屋市在住。主にボーカル楽曲（特に電波ソングといわれる類）と音楽ゲームをイメージしたインスト楽曲の作成を主に活動しています。
感性に身を任せた特徴的な楽曲を武器に、数々の音楽ゲームに楽曲提供。 また、DJイベント出演やコミックマーケットの一斉点検放送ジングルも手掛けるなど、いろんなところに出没している。 制作ジャンルは、主に電波ソング、テクノポップ。趣味はコスプレ。

ねこみりんが運営する個人同人音楽サークル「nekomimi style」

', 'http://p1.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg', 12356148, 'ねこみりん', 2481);
INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (747, '風鈴ぼるけいの', '# 简介
 「風鈴ぼるけいの」は、ちょっと古風な音楽と可愛い小物を作りつつ、ときどきカリグラフィーやタイポグラフィーを頑張る雑貨サークルです。
2015年8月、音楽サークル「街角麻婆豆」の中の笛奏者3人で結成。笛を主体とした古楽・室内楽・ちょっと古風なポップスで活動しています。
主な活動ジャンルは東方・とうらぶ・アニソン・クラシック・古楽・オリジナルなど。
