INSERT INTO tongrenlu.m_artist (id, name, description, cloud_music_pic_url, cloud_music_id, cloud_music_name, tag_id) VALUES (810, '来兎', '# 简介
 来兎（らいと、本名：久場 超（くば まさる）、1月30日 - ）は日本のゲーム音楽作曲家。沖縄県沖縄市出身。株式会社リサレコ代表。
アンダーナイトインヴァース、メルティブラッド、魔神少女シリーズ、おそ松さんのへそくりウォーズ等ゲーム音楽を中心に、Study、でんぱ組.inc等 声優、アイドルへの楽曲提供、CM音楽多数。

', 'http://p1.music.126.net/yxuNwjRcMGiQJ868P93TDw==/14456378882015375.jpg', 160934, '来兎', 2714);
